import React, { Component } from 'react';

class Search extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                <div className="col-10 mx-auto col-md-8 mt-5 text-center">
                <h1 className="text-slanted text-capitalize">
                    search recipes with{" "}
                    <strong className="text-orange">Food2Fork</strong>
                </h1>
                <form className="mt-4">
                    <label htmlFor="search" className="text-capitalize">types recipes separated by comma</label>
                    <div className="input-group">
                    <input type="text" name="search" className="form-control" placeholder="chicken,onion,carrors" />

                    </div>
                </form>
                </div>
                </div>
            </div>
        );
    }
}

export default Search;
